import React from 'react';
import { BoxInfo, Image, Title, SubTitle1, SubTitle2, SubTitle3, SubTitle4 } from './styles';

export default function CardInfo({item}) {

    return (
        <>
            <BoxInfo>
                <Image src={item.image}></Image>
                <Title>{item.title}</Title>
                <SubTitle1>{item.subtitle}</SubTitle1>
                <SubTitle2>{item.subtitle}</SubTitle2>
                <SubTitle3>{item.subtitle}</SubTitle3>
                <SubTitle4>{item.subtitle}</SubTitle4>
            </BoxInfo>
        </>
    )
}
